import React from "react";
import data from "../Data2.json";

function Clients() {
  return (
    <div className="container d-flex flex-column justify-content-center align-items-center text-center text-light">
      <h2>Our Clients</h2>
      <p className="w-50">
        Our clients aren't just clients; they are valued partners in progress.
        We take pride in understanding their unique needs, tailoring solutions,
        and fostering long-term relationships.
      </p>
      <swiper-container
        class="mySwiper my-5"
        loop="true"
        space-between="40"
        speed="3000"
        style={{ width: "100%" }}
        slides-per-view="6"
        autoplay-delay="1"
        autoplay-disable-on-interaction="false"
        free-mode="true"
        free-mode-momentum="false"
      >
        {data.map((a) => (
          <swiper-slide
            key={a.id}
            style={{
              backgroundImage: `url(${a.img})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              width: "100px",
              height: "150px",
              borderRadius: "50%",
              boxShadow: "inset 0px 0px 10px black",
            }}
          ></swiper-slide>
        ))}
      </swiper-container>
    </div>
  );
}

export default Clients;
